'use strict';

angular.module('zupWebAngularApp')
  .directive('filterItems', function () {
    return {
      restrict: 'A',
      link: function postLink(scope, element, attrs) {
        var disabledIcon;
        var enabledIcon;
        var disabledIconIndex = [];
        var arvoresDisabledIcon = 'data:image/png;base64,';
        var bocaLoboDisabledIcon = 'data:image/png;base64,';
        var pracaWifiDisabledIcon = 'data:image/png;base64,';
        var arvoresEnabledIcon = 'data:image/png;base64,';
        var bocaLoboEnabledIcon = 'data:image/png;base64,';
        var pracaWifEnabledIcon = 'data:image/png;base64,';

        disabledIconIndex[4] = arvoresDisabledIcon;
        disabledIconIndex[5] = bocaLoboDisabledIcon;
        disabledIconIndex[6] = pracaWifiDisabledIcon;

        if (scope.category.id === 4) {
          disabledIcon = arvoresDisabledIcon;
          enabledIcon = arvoresEnabledIcon;
        }
        if (scope.category.id === 5) {
          disabledIcon = bocaLoboDisabledIcon;
          enabledIcon = bocaLoboEnabledIcon;
        }
        if (scope.category.id === 6) {
          disabledIcon = pracaWifiDisabledIcon;
          enabledIcon = pracaWifEnabledIcon;
        }

        var disableIcon = function() {
          element.find('span.image').css('background-image',  'url(' + disabledIcon + ')');
        };

         var enableIcon = function() {
           element.find('span.image').css('background-image', 'url(' + enabledIcon + ')');
        };

        element.hover(function() {
          enableIcon();
        }, function() {
          if (!element.hasClass('active'))
          {
            disableIcon();
          }
        });

        element.click(function() {
          // let's disable reports icons
          $('.report_category_icon').removeClass('active');
          $('.inventory_category_icon').each(function() {
            var elScope = angular.element(this).scope();
            var catId = elScope.category.id;
            $(this).find('span.image').css('background-image', 'url(' + disabledIconIndex[catId] + ')');
            $(this).removeClass('active');
          });

          element.toggleClass('active');

          if (element.hasClass('active'))
          {
            enableIcon();
          }
          else
          {
            disableIcon();
          }
        });

        // start with disabled icon
        disableIcon();
      }
    };
  });
